import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [posts, setPosts] = useState([]); // 게시물 목록을 저장할 상태

  useEffect(() => {
    axios.get('/api/posts')  // 백엔드의 게시물 목록 조회 엔드포인트 호출
        .then(res => setPosts(res.data))
        .catch(err => console.log(err))
  }, []);

  return (
      <div>
        <h1>게시물 목록</h1>
        <ul>
          {posts.map(post => (
            <li key={post.id}>
              <h2>{post.title}</h2>
              <p>{post.content}</p>
              <p>작성자: {post.author}</p>
            </li>
          ))}
        </ul>
      </div>
  );
}

export default App;
